export const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="products">
        <button>X</button>
        <p>Products</p>
      </div>
      <input type="search" placeholder="Search product..." />
      <button>My account</button>
      <button>Favorites</button>
      <p>Cart</p>
    </nav>
  );
};
